import React from "react";
import ReactDOM from "react-dom";
import "./index.css"
import Card from "./Card";
import Sdata from "./Sdata";

const nData = ()=>{
  return(
    <Card
    imgsrc={Sdata[0].imgsrc}
     title={Sdata[0].category}
     sname={Sdata[0].title}
     Link={Sdata[0].link}

 />
  )
}

ReactDOM.render(
  <>
  <h1 className="text-center m-3">Official Netflix Movies</h1>,


        {Sdata}.map(nData)


  </>,
  document.getElementById("root")
)
